    const handleClick = (e) => {
        e.preventDefault()
        router.push('/blog/')
    }
    
    var { id } = router.query
    

    const router = useRouter();
    var { title } = router.query
    var title = JSON.stringify({title})
    
    let x = JSON.stringify({id});
